import React from "react";
import "../../Styling/LandingPage/menu.css";
import "../../Styling/LandingPage/style.css";
// import logo from "../../Images/star.png";
import {
  TweenMax,
  TweenLite,
  TimelineMax,
  TimelineLite,
  Linear,
  Back,
  Sine,
  Bounce
} from "gsap";

class LandingPage extends React.Component {
  render() {
    // TweenMax.to(".page-body", 0, { css: { opacity: 0, top: -400 } });
    // TweenMax.to(".page-body", 4, { css: { opacity: 1, top: 200 } });
    TweenMax.to(".landing-title", 0.5, {
      down: 10,
      // backgroundColor: "#f00",
      padding: 20,
      borderColor: "white",
      borderRadius: 26,
      y: 10
    });
    TweenMax.to(".landing-title", 2, {
      right: 800,
      // backgroundColor: "#f00",
      padding: 20,
      borderColor: "white",
      borderRadius: 26,
      x: -800,
      delay: 2
    });
    TweenMax.to(".landing-title", 2, {
      left: 400,
      // backgroundColor: "#f00",
      padding: 20,
      borderColor: "white",
      borderRadius: 26,
      x: 0,
      delay: 4,
      ease: Bounce.easeOut
    });
    TweenMax.staggerFrom(
      ".box",
      1,
      {
        opacity: 0,
        y: 200,
        rotation: 360,
        scale: 2,
        delay: 6
      },
      0.2
    );

    return (
      <div className="page-body">
        <header className="showcase">
          <div className="container showcase-inner">
            <h1 className="landing-title">Welcome to Wunder</h1>
            <p className="lets">Let's Eat!</p>
            <a href="/main" className="landingPage-btn">
              Enter
            </a>
          </div>
        </header>
      </div>
    );
  }
}

export default LandingPage;
